Prompt 1: Christmas Dinner
.
If your best friend is a Yeti of course you'd have your Christmas dinner outside on a tree stump. In 2021 I introduced Yuri and Yeti and although I originally was not going to use them again this year, I decided at the last minute I would. It's #Advent_Challenge time and let's see how Yuri and Yeti handle all of the prompts. 
.
The idea of a having a Christmas dinner outside came from my own experience. When my children were little, I made a big picnic lunch to have outside on New Year's day. We'd go to a park along the Potomac River that has huge waterfalls. Sometimes there would be ice on the river, sometimes snow, and it was always cold. We'd bundle up and I'd take blankets to wrap around us. I'd pack a big thermos of hot soup, leftovers from New Year's eve dinner, and boxes of Christmas sweeties. I felt it was important for us to start the first day of the year outside and this would set the tone for the whole year for my family. I'll try to dig up a photo from one of our picnics to put in my story.
.
