Part 2: INK
.
For @folktaleweek this year I wrote a folktale inspired story to match the prompts. Henry O'Hennessy's story continues. If you want to read Part 1: LOST to catch up, see Monday's post.
.
Henry tumbled all the way down the ridge to the beach below.

A tall ship was anchored in the harbor and there were three sailors loading a rowboat with supplies.

Henry had always wanted to see a tall ship up close.

He ran to them shouting “I am a Big Boy! I am a BIG BOY!”

They looked down at Henry.

“Are you big enough to fetch my tea?” one asked.

“Are you big enough to feed the goats?” another quizzed.

“Are you big enough to clean our boots?” the last one inquired.

“I am a Big Boy!” Henry shouted.

One of the sailors pulled out a parchment from inside his coat. “Then, you will be our cabin boy. Please sign here.” he said pointing to the bottom of the paper.

Henry signed.
.
