Henry thought about his mother in the quiet of the nighttime ship.

He had lost the note she gave him, and the coins were gone too.

If only he really were a big boy, then maybe he would not have gotten lost, and maybe he would not be homesick and seasick on this ship.

He just wanted to be home even if he was a little big boy after all.

His hammock swung this way and that way, matching the ocean swells, gentle, like his mother’s rocking chair.

Henry was very, very sleepy...then he heard a loud crash…
.
