Part 5: UNDERGROUND
.
For @folktaleweek this year I wrote a folktale inspired story to match the prompts. Henry O'Hennessy's story continues. If you want to catch up, please start with Monday's post.
.
The ship had hit some rocks and was sinking.

Henry saw that the cabin was filling up with water fast.

A tentacle reached in through a hole in the ship’s haul, and a large octopus said “This way Henry.”

Henry was just small enough to swim through the hole.

Once outside a whale motioned for Henry to follow.

“Henry, this tunnel will lead you to safety.”

Henry could just squeeze through the tiny tunnel which opened into an underground cave.

Light was coming in from an opening in the roof of the cave and it shone on a mermaid sitting in a pool of water.

“Henry that opening at the top of the cave is your way out.”

Henry had no idea how he could reach that hole, but the mermaid spoke to some sea birds who had nests along the wall.

The sea birds swooped down and picked up light little Henry and carried him higher and higher…
.
