Part 6: ILLUSION 
.
For @folktaleweek this year I wrote a folktale inspired story to match the prompts. Henry O'Hennessy's story continues. If you want to catch up, please start with Monday's post.
.
Henry awoke on the highest part of a tiny island.

Had his escape all been a dream?

The sailors were in the water looking up at him.

“Are you alright big boy?” one sailor asked.

Henry blinked “I am not a big boy. I am a little boy and I want to go home.”

As the sailors swam back to the sinking ship to see what they could salvage, Henry thought he saw a whale. And was that a tentacle? One of the sailors stopped to talk to some sea birds.

Henry waited and waited. He didn’t see the sailors anywhere.
.
