Henry sat on the little island.

He didn't see the sailors anymore.

He watched the waves and thought about his mother, holding him in her rocking chair.

She would say “Try to enjoy being who you are now. You will be a big boy soon enough.”

If only he could just go home again, he’d be happy to be a little boy. Her little boy.

And then he saw a cloud of sea birds followed by a boat.
.
