YOUR TRADITIONS—12 Days of Christmas
.
Most of my traditions include the typical ones—like baking from passed-down recipes, decorating with heirloom ornaments and gifts of books and sweet treasures. But we have an unusual tradition too. Each year at Christmas time we spend several days by the seashore with extended family. Within that time we’ve crafted some of our own unique traditions related to that place—hikes to the dunes and the lighthouse, visits to local bookstores, steamer pot meals, and locally made donuts for breakfast. Several times I’ve seen bottles with messages left by the edge of the sea. Whose tradition is this I wonder?
