PEACE ON EARTH—12 Days of Christmas
.
There are so many struggles and much suffering on this day in our little world. This was a hard image for me to make. Peace seems so far away. There is joy all around and I want to be part of that…but sometimes there is a catch in my breath. The merrymaking just doesn’t feel right. I’m still hopeful though…that people will look to each other and see themselves. Then perhaps we can find our way to peace.
